Add-Type -AssemblyName PresentationFramework

# الصورة مضمنة داخل السكربت
$imgBase64 = @"

"@

# تحويل Base64 إلى بايتات
$bytes = [Convert]::FromBase64String($imgBase64)
$ms = New-Object System.IO.MemoryStream
$ms.Write($bytes, 0, $bytes.Length)
$ms.Position = 0

# إنشاء نافذة WPF وعرض الصورة
[xml]$xaml = @"
<Window xmlns="http://schemas.microsoft.com/winfx/2006/xaml/presentation"
        Title="تحذير" WindowStartupLocation="CenterScreen"
        SizeToContent="WidthAndHeight" WindowStyle="None" Background="Black" Topmost="True">
    <Grid>
        <Image Name="img" Stretch="None"/>
    </Grid>
</Window>
"@

$reader = (New-Object System.Xml.XmlNodeReader $xaml)
$window = [Windows.Markup.XamlReader]::Load($reader)

$bitmap = New-Object System.Windows.Media.Imaging.BitmapImage
$bitmap.BeginInit()
$bitmap.StreamSource = $ms
$bitmap.EndInit()

$window.FindName("img").Source = $bitmap
$window.ShowDialog() | Out-Null
